import logo from "./logo.svg";
import "./App.css";
import React, { useState, useEffect } from "react";
import axios from "axios";

function App() {
  const [data, setData] = useState("");

  useEffect(() => {
    axios.get("/").then((response) => {
      setData(response);
    });
  });

  return (
    <div className="App">
      <header></header>
      <body>
        <p>{data}</p>
      </body>
    </div>
  );
}

export default App;
